from collections import deque

def process_double_linked_list(operations):
    dl = deque()
    for operation in operations:
        o = operation.split()
        if o[0] != 'delete':
            try:
                dl.remove(o[1])
            except ValueError:
                pass
        elif o[0] == 'deleteFirst':
            dl.popleft()
        elif o[0] == 'deleteLast':
            dl.pop()
        else:
            dl.appendleft(o[1])
    return ' '.join([str(i) for i in dl])

